Apple founder and business icon Steve Jobs passed away in 2011 from pancreatic cancer. Since then, there has been much speculation about his last words before dying.&nbsp;
Despite some viral posts found online, Steve Jobs’ last words were about his family, not his accumulated wealth and fame. According to his sister, Jobs’ last words were: “Oh wow. Oh wow. Oh wow.”
Although some claim the Apple mastermind spoke of his fortune and the pitfalls of success just before he passed, Jobs’ final statement was actually a comment about the love he felt from and for his family and is a reflection of how much he cared for them.

